var siAppFilters=angular.module("siApp.filters",[]);siAppFilters.filter("numberToLetter",function(){return function(input,toLower){var retval="FORMAT-REJECTED: "+input;if(!isNaN(input)){if(toLower)retval=String.fromCharCode(97+input);else retval=String.fromCharCode(65+input);retval+="."}return retval}});
